	(9,'子菜单21','','',1,'0','<p><span style=\"color: rgb(51, 51, 51); font-family: 微软雅黑; font-size: 14px; text-indent: 28px; background-color: rgb(255, 255, 255);\">公司前期是英国有机农业研究所，成立于1872年。1955年成立碧绿源作物营养保护有限公司，一直致力于有机生态农业的发展，公司旗下有戴维斯，沃克院士领导的博士，硕士研发团队二十多人在世界有机生态全营养功能液肥研究课题上权威领导团队。 公司始终致力于绿色有机生态农业的发展，秉承科学农业方针，愿与业界各方致力于发展有机农业，科学农业的团体人士精诚合作，共同发展。 碧果作为农业高端有机型液肥，采用深海鱼油等多类珍贵物质，补充不同作物各个时期的全面营养需求，全面改善作物生长状态及品质，显著提高产量</span></p>',1497920097,1,'','',0,2,'',1,'0'),
	(10,'子菜单22','','',1,'0','<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; line-height: 30px; text-indent: 2em;\">作为专业的营养液研发制造企业、碧绿源在此领域拥有最新的技术和高端的设备，微客户提供国际品质的碧绿源产品，严格执行ISO900：.2000国际管理体系。</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; line-height: 30px; text-indent: 2em;\">每个产品均按标准组织生产，检验、从原料，半成品，中间生产环节到成品有15个以上检测成语，确定产品各项指标符合产品标准要求。</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; line-height: 30px; text-indent: 2em;\">专业品质的保证、专业化的经营、科学化的管理、标准化的流程、高品质的产品，给碧绿源获得了更多参与国际市场竞争的机会。</p><p><img src=\"http://by.demo.ktwlkj.com/biguo/images/about1.png\" alt=\"\"/></p><p><img src=\"http://by.demo.ktwlkj.com/biguo/images/about2.png\" alt=\"\"/></p><p><img src=\"http://by.demo.ktwlkj.com/biguo/images/about3.png\" alt=\"\"/></p><p><img src=\"http://by.demo.ktwlkj.com/biguo/images/about4.png\" alt=\"\"/></p><p><img src=\"http://by.demo.ktwlkj.com/biguo/images/about5.png\" alt=\"\"/></p><p><img src=\"http://by.demo.ktwlkj.com/biguo/images/about6.png\" alt=\"\"/></p><p><br/></p>',1497920100,1,'','',0,2,'',1,'0'),
	(11,'子菜单23','','',1,'0','<h2 style=\"box-sizing: border-box; font-family: inherit; font-weight: normal; line-height: 24px; color: rgb(76, 177, 202); margin: 15px 0px; font-size: 16px; text-indent: 0em; border-left-style: solid; border-left-width: 5px; padding-left: 15px;\">齐心协力 共创未来</h2><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; line-height: 30px; text-indent: 2em;\">英国碧绿源作物营养保护有限公司是、研发、生产、销售为一体的国际集团。跟法国瑞士有机农业研究是长期的战略合作伙伴。 公司前期是英国有机农业研究所，成立于1872年。1955年成立碧绿源作物营养保护有限公司，一直致力于有机生态农业的发展，公司旗下有戴维斯，沃克院士领导的博士，硕士研发团队二十多人在世界有机生态全营养功能液肥研究课题上权威领导团队。 公司始终致力于绿色有机生态农业的发展，秉承科学农业方针，愿与业界各方致力于发展有机农业，科学农业的团体人士精诚合作，共同发展。</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; line-height: 30px; text-indent: 2em;\">我们公司经过多年的发展，客户遍布全国各地，涉及行业广泛。我 们本着“用户至上、信誉第一”宗旨，热诚为新老客户服务，欢迎全 国各地的客商来电洽谈。</p><h2 style=\"box-sizing: border-box; font-family: inherit; font-weight: normal; line-height: 24px; color: rgb(76, 177, 202); margin: 15px 0px; font-size: 16px; text-indent: 0em; border-left-style: solid; border-left-width: 5px; padding-left: 15px;\">创意</h2><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; line-height: 30px; text-indent: 2em;\">体验经济时代的企业，其存续的关键在于创意，创意源自于全体同仁观念，与思想的革新，我们凝聚的是经营、战略、营销、产品与服务的创意与创新能力，持续公司的成长力。</p><h2 style=\"box-sizing: border-box; font-family: inherit; font-weight: normal; line-height: 24px; color: rgb(76, 177, 202); margin: 15px 0px; font-size: 16px; text-indent: 0em; border-left-style: solid; border-left-width: 5px; padding-left: 15px;\">生意</h2><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; line-height: 30px; text-indent: 2em;\">有创意、才有生意，个人有超越自我的企图心，与核心竞争力，公司才有持续生长的生命力与落实使命的执行力量。</p><h2 style=\"box-sizing: border-box; font-family: inherit; font-weight: normal; line-height: 24px; color: rgb(76, 177, 202); margin: 15px 0px; font-size: 16px; text-indent: 0em; border-left-style: solid; border-left-width: 5px; padding-left: 15px;\">诚意</h2><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; line-height: 30px; text-indent: 2em;\">诚实有信用，以诚意为客户着想，服务客户，同仁之间以诚意相互信任，照顾与提携，这是工作行为的最高准则，</p><p><br/></p>',1497920105,1,'','',0,2,'',1,'0'),
